import React, { useState } from 'react';
import '../../App.css';
import './nav.css'

function Nav() {
  const [showDiv1, setShowDiv1] = useState(false);
  const [showDiv2, setShowDiv2] = useState(false);
  const [bntColor, setColor]=useState('#333');
  const [btnBgd, setBgd]=useState('#ffb703')

  const handleToggle1 = () => {
    setShowDiv1(!showDiv1);
  };

  const handleToggle2 = () => {
    setShowDiv2(!showDiv2);
  };

  const handleBgd={
    setColor
  }

  return (
    <div>
      <nav id="nav">
        <button class="nav_link" onClick={handleToggle1}>Кафедра </button>
        <button class="nav_link" onClick={handleToggle2}>Багыттары </button>
        <button class="nav_link">Жанылыктар </button>
        <button class="nav_link">Иш-чаралар </button>
        <button class="nav_link">Байланыш үчүн </button>
      </nav>
      {showDiv1 && (
        <div id="hiddenDiv1">
          <div class="container">
            <div class="togged_kafedra">
              <div class="part1">Кафедра</div>
              <div class="part2">
                <ul>
                  <li>Тарыхы</li>
                  <li>Курамы</li>
                  <li>Аккредитация</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
      {showDiv2 && (
        <div id="hiddenDiv2">
          <div class="container">
            <div class="togged_bagytary">
              <div class="part1">багыттар жана профилдер</div>
              <div class="part2">
                <ul>
                  <li>Графика</li>
                  <li>Информатика жана Эсептөө техникасы</li>
                </ul>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Nav;
